import React, {Component} from 'react';

class FrontPage extends Component {
  render(){
    return (
        <div>
        <div id="bg">

          <img src={require('./imgs/star_background.jpg')}/>
        </div>
        <h1><span className="title">Title</span></h1>
        </div>
     );
  }

}

export default FrontPage;
